"""
Given two strings s and p, return an array of all the start indices of p's anagrams in s. You may return the answer in any order.

An Anagram is a word or phrase formed by rearranging the letters of a different word or phrase, typically using all the original letters exactly once.

 

Example 1:

Input: s = "cbaebabacd", p = "abc"
Output: [0,6]
Explanation:
The substring with start index = 0 is "cba", which is an anagram of "abc".
The substring with start index = 6 is "bac", which is an anagram of "abc".
Example 2:

Input: s = "abab", p = "ab"
Output: [0,1,2]
Explanation:
The substring with start index = 0 is "ab", which is an anagram of "ab".
The substring with start index = 1 is "ba", which is an anagram of "ab".
The substring with start index = 2 is "ab", which is an anagram of "ab".
"""
from collections import defaultdict


class Solution:
    def areAnagrams(self, sMap):
        for character in sMap:
            if character in self.pMap and sMap[character] == self.pMap[character]:
                continue
            else:
                return False
        return True

    def findAnagrams(self, s: str, p: str):
        left, right = 0, len(p) - 1
        sLen = len(s)
        startIndices = []
        self.pMap = defaultdict(int)
        for character in p:
            self.pMap[character] += 1
        sMap = defaultdict(int)
        for character in s[left : right + 1]:
            sMap[character] += 1

        while True:
            if self.areAnagrams(sMap):
                startIndices.append(left)
            sMap[s[left]] -= 1
            if sMap[s[left]] == 0:
                del sMap[s[left]]
            left += 1
            right += 1
            if right > sLen - 1:
                break
            sMap[s[right]] += 1
        return startIndices


# Driver code
sol = Solution()
assert sol.findAnagrams("cbaebabacd", "abc") == [0, 6]
assert sol.findAnagrams("abab", "ab") == [0, 1, 2]
assert sol.findAnagrams(
    "",
    "",
)
